@Pamber 13 I have been in toxic relationships and after 2.5 years of therapy (after the last one), I realised and accepted that it was my fault. I was the one who allowed myself to be treated badly because of how I grew up. I grew up in a home where I was taught to lie about my feelings in order to not upset my mother. My feelings never mattered. When I'd say I was sick and could not go to school, I'd be told I was lying. Stuff like that. Or I'd be blamed for stuff I didn't do, and when it comes out that I didn't do it, I'd never get an apology. I started thinking I was wrong for any little thing. And then as I got older, after attracting abusive and manipulative women my whole life (to the point that I even started hooking up with men to avoid women altogether, thinking that was the problem) I realised that it came from my childhood. Even the men I attracted were manipulative and shady. 
It was a lot of work to get my mind right, but I finally worked through it and now I attract healthier people who treat me with honesty. Yes, it's not as "fun" or "exciting". Women like Amber Heard are addictive, but it's only cause they're good manipulators and they make you feel special as a trick. 
I never judge a situation publicly unless I've been through something similar. I've been with so many gaslighting, drama queen women (lying, scheming, listening  through the door to private conversations with my friends, secretly recording my voice...It goes on) way more than manipulative men, that I still find it difficult to trust women and I probably never will (in a romantic relationship context) ever again in this lifetime.

